  [],\n\t\"revision_timestamp\": \"2016-07-27T22:56:40.980520\",\n\t\"name\": \"tamarac-national-wildlife-refuge-annual-narrative-report-calendar-year-1991\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Tamarac
  National Wildlife Refuge outlines Refuge accomplishments during the 1991 calendar
  year. The report begins with a summary of the year's highlights and weather conditions.
  Land acquisition is covered. The report includes a planning section which discusses
  management planning, compliance with environmental and cultural resource mandates,
  and research and investigations. Refuge administration is outlined; information
  about personnel, youth programs, other manpower programs, volunteer programs, funding,
  safety, and technical assistance is given. Habitat management is also covered; subjects
  include wetlands, forests, croplands, grasslands, fire management, pest control,
  water rights, farmers home administration conservation easements, and private lands.
  The wildlife section of the report discusses endangered and threatened species,
  waterfowl, marsh birds and waterbirds, shorebirds, raptors, other migratory birds,
  game mammals, other resident wildlife, wildlife propagation and stocking, scientific
  collections, animal control, and marking and bird banding. The public uses of the
  Refuge described in this report include outdoor classrooms, interpretive programs,
  hunting, fishing, trapping, wildlife observations, other wildlife oriented recreation,
  picnicking, law enforcement, and cooperating associations. The equipment and facilities
  section of the report provides information about new construction, rehabilitation,
  major maintenance, equipment utilization and replacement, communications systems,
  computer systems, and energy conservation. Cooperative programs and items of interest
  are included. Photographs and Refuge brochures are attached.\",\n\t\"license_title\":
